// Contact.jsx
import React from 'react';
import '../assets/styles/App.css';
import sigilism from '../assets/imgs/sigilism-contact.png';

const Contact = () => {
  return (
    <div className="content" style={{ height: '100vh', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
      <div style={{ zIndex: '10', position: 'relative', height: '80%' }}>
        <img src={sigilism} alt="" style={{ height: '100%' }} />
      </div>

      <h1 style={{ color: '#e96f7c', textAlign: 'center', marginTop: '20px' }}>
        - Contact -
        <br />
        In maintenance
      </h1>
    </div>
  );
};

export default Contact;
